import Link from "next/link";
import styles from "./SideBarNav.module.css";

const SideBarNav = () => (
  <nav class={styles.sidebarcontainer}>
    <img
      src="resources/medstarhealth.png"
      class="img-fluid"
      alt="Responsive image"
    ></img>
    <ul class="nav-links">
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/search">
        <a>Search</a>
      </Link>
    </ul>
  </nav>
);

export default SideBarNav;
